import React from "react";
import './App.css';
import Login from './pages/login.js';
import Home from './pages/home.js'; // Importe o componente Home
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Importe os componentes do React Router

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/pages/home" element={<Home />} /> {/* Adicione a rota para Home */}
        </Routes>
      </div>
      <Routes>
                <Route index element={<Estoque />} />
                <Route path='/pages/config' element={<Config />} />
                <Route path='/pages/cadastrar' element={<Cadastrar />} />
                <Route path='/pages/alterar/:id' element={<Alterar />} />
                <Route path='/pages/estoque' element={<Estoque />} />
            </Routes>
    </BrowserRouter>
  );
}

export default App;
